(10, 1, 1, 1, 'video', 'Introduction to Book-keeping  ', '<div class=\"Grid__Element-jkfhmu-0 IKBDv Grid\">\r\n<div class=\"Row__Element-sc-1uq5y45-0 eQbBFr Row\">\r\n<div class=\"Col__Element-sc-564e4q-0 kxxnof Col\">\r\n<p class=\"Typography__Element-sbi4m0-0 civxeD Typography\">Bookkeeping traditionally refers to the day-to-day upkeep of a business&rsquo;s financial records. Bookkeepers used to simply gather and quality-check the information from which accounts were prepared. But their role has expanded over time, and we&rsquo;ll look at how in the next chapter.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"Grid__Element-jkfhmu-0 IKBDv Grid\">\r\n<div class=\"Row__Element-sc-1uq5y45-0 eQbBFr Row\">\r\n<div class=\"Col__Element-sc-564e4q-0 kxxnof Col\">\r\n<p class=\"Typography__Element-sbi4m0-0 civxeD Typography\">Accounting refers to the analysis, reporting and summarizing of the data that bookkeepers gather. Accounting reports give a picture of the financial performance of a business, and determine how much tax is owed.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"Grid__Element-jkfhmu-0 IKBDv Grid\">\r\n<div class=\"Row__Element-sc-1uq5y45-0 eQbBFr Row\">\r\n<div class=\"Col__Element-sc-564e4q-0 kxxnof Col\">\r\n<p class=\"Typography__Element-sbi4m0-0 civxeD Typography\">An accounting degree requires deep education and training in tax and other laws with which businesses need to comply, plus finance and business management. While some bookkeepers may have developed similar skills, that level of training isn&rsquo;t required to be called a bookkeeper.</p>\r\n</div>\r\n</div>\r\n</div>', 'https://cbspace.sgp1.cdn.digitaloceanspaces.com/kokateclasses/courses/lectures/28ccb79a822da22dd53bdd4613e918ad1.mp4', '', 0, 'https://cbspace.sgp1.cdn.digitaloceanspaces.com/kokateclasses/courses/lectures/bk259e89a0dde2a1dfbd2044be3ab04bd78.jpg', '00:53:00', '16356821', 1, 0, '2022-01-21 03:14:46', '2022-02-26 03:20:55'),
