(1, '11th Commerce', 'It Includes all Subject of the 11th Commerce', '<p>Introduction To Commerce</p>\n<div id=\"page\" class=\"site grid-container container hfeed\">\n<div id=\"content\" class=\"site-content\">\n<div id=\"primary\" class=\"content-area\"><main id=\"main\" class=\"site-main\">\n<article id=\"post-5512\" class=\"post-5512 post type-post status-publish format-standard has-post-thumbnail hentry category-market-trends tag-activities-which-aid-commerce tag-characteristics-of-commerce tag-importance-of-commerce tag-introduction-to-commerce tag-scope-of-commerce\">\n<div class=\"inside-article\">\n<div class=\"entry-content\">\n<div class=\"code-block code-block-1\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-6753082454606053\" data-ad-slot=\"4578823545\" data-ad-format=\"auto\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" data-ad-status=\"unfilled\"><ins id=\"aswift_2_expand\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><ins id=\"aswift_2_anchor\"></ins></ins></ins><strong>Meaning And Definition Of Commerce</strong></div>\n<ol>\n<li><strong>Importance Of Commerce</strong></li>\n<li><strong>Characteristics Of Commerce</strong></li>\n<li><strong>Functions Of Commerce</strong></li>\n<li><strong>Scope Of Commerce</strong></li>\n<li><strong>Activities Which Aid Commerce:</strong></li>\n<li><strong>Division Of Trade</strong></li>\n</ol>\n<p><strong>MEANING OF COMMERCE</strong></p>\n<p>Commerce has been defined in various ways by various authors, but a comprehensive definition of &ldquo;Commerce is the act of buying and selling of goods and services to satisfy human wants so as to earn a living.</p>\n<p>&nbsp;</p>\n<p><strong>IMPORTANCE OF COMMERCE</strong></p>\n<div class=\"code-block code-block-2\"><ins class=\"adsbygoogle\" data-ad-layout=\"in-article\" data-ad-format=\"fluid\" data-ad-client=\"ca-pub-6753082454606053\" data-ad-slot=\"9962178016\" data-adsbygoogle-status=\"done\" data-ad-status=\"unfilled\"><ins id=\"aswift_5_expand\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><ins id=\"aswift_5_anchor\"></ins></ins></ins>1. Through Commerce the exchange of goods and services are made possible.</div>\n<div class=\"code-block code-block-1\">\n<p>2. Commerce brings about development of a nation as well as a city.</p>\n<p>3. Commerce creates employment opportunities for the citizens of a country through insurance, advertising.</p>\n<p>4. Commerce makes the storage of goods or raw materials through warehousing.</p>\n<p>5. Commerce encourages import and export, thereby bring about specialization.</p>\n<div class=\"code-block code-block-1\">\n<p>Commerce improves the standard of living because more people earn their living through commercial activities.</p>\n<p>&nbsp;</p>\n<p><strong>CHARACTERISTICS OF COMMERCE</strong></p>\n</div>\n<div class=\"code-block code-block-1\">\n<p><strong>1. Economic Activity:</strong>&nbsp;Commerce is an economic activity. A trader buys and sells goods to earn wealth. It is expressed in monetary terms.</p>\n<p><strong>2. Profit:</strong>&nbsp;The native of commerce is to earn profit. Gifts of goods to friends and relative is not commerce. Profit drives the engine of commerce.</p>\n<p>3.&nbsp;<strong>Marketing:</strong>&nbsp;Commerce involves marketing. It involves the exchange, distribution and production. It is done on regular basis. Marketing is done to create goods and satisfy customers.</p>\n<p><strong>Utility:</strong>&nbsp;Commerce creates place and time utility to satisfy consumers needs. It transports goods from place to place to create place utility. It creates time utility.</p>\n<p>&nbsp;</p>\n<p><strong>FUNCTIONS OF COMMERCE (TRADE)</strong></p>\n<p>1. Commerce facilitate mass production thus people all over the world can enjoy goods and services produced both within and outside the country.</p>\n<p>2. It facilitates the raising of capital for individual needs and investment through services of bank and other financial institutions.</p>\n<p>3. It offers employment opportunities to large number of people.</p>\n<p>4. It assists in making people raw materials and finished goods from production points to consumption points through transportation.</p>\n<p>5. It fastens unity among nations, thus nations become interdependent as they engage in trading activities.</p>\n<p>&nbsp;</p>\n<p><strong>SCOPE OF COMMERCE</strong></p>\n<p>This involves all the activities which ensure the distribution and exchange of goods and services for the satisfaction of the people.</p>\n<p>Different Activities Engaged In, By people in commercial occupation, include-</p>\n<p>a. Trading</p>\n<p>b. Transporting</p>\n<p>c. Warehousing</p>\n<p>d. Insurance</p>\n<p>e. Banking</p>\n<p>f. Advertising</p>\n<p>g. Communication</p>\n<p>h. Tourism</p>\n<p>The Scope Of Commerce is illustrated below:</p>\n<p><strong>COMMERCE</strong></p>\n<p><strong>1. Trade</strong>&nbsp;(We have Home Trade And Foreign Trade)</p>\n<p><strong>Home Trade:</strong>&nbsp;Retail And Wholesale.</p>\n<p><strong>Foreign Trade:</strong>&nbsp;Export, Import, Entreport.</p>\n<p><strong>2. Aids To Trade</strong></p>\n<p>&ndash; Banking</p>\n<p>&ndash; Advertising</p>\n<p>&ndash; Warehousing</p>\n<p>&ndash; Tourism</p>\n<p>&ndash; Communication</p>\n<p>&ndash; Insurance</p>\n<p><strong>ACTIVITIES WHICH AID COMMERCE</strong></p>\n<p>There are certain activities which makes Commerce possible and they are as follows:</p>\n<p>1)&nbsp;<strong>Banking</strong>: Banking Aid trade by helping people to safeguard their money and other valuable items as well as offering loans to business men and women.</p>\n<p>2)&nbsp;<strong>Insurance</strong>: Insurance is a provision made against risks and insurance companies helps to restore people to their formal position, they should incur any risks/loss insured against.</p>\n<p>3)&nbsp;<strong>Advertising</strong>: Advertising is the process by which awareness is created about existing goods and services and through Advertising , buying and selling is enhanced.</p>\n<p>4)&nbsp;<strong>Warehousing</strong>: Warehousing is the act of storing goods ahead of demand for them, and through Warehousing trade will not be disrupted as goods produced are stored ahead of demand for them.</p>\n<p>5)&nbsp;<strong>Transportation</strong>: Transportation is the movement of goods and people from one place to another and transportation aids trade.</p>\n<p>6)&nbsp;<strong>Communication</strong>: Communication is the process of sending and receiving information between two people, group and others.</p>\n<p><strong>DIVISION OF TRADE</strong></p>\n<p>Commerce is divided into two:-</p>\n<p>1) Home Trade</p>\n<p>2) Foreign Trade</p>\n<p>(1)&nbsp;<strong>Home Trade</strong>: This is a trade that is carried out within a particular country. It is also known as domestic trade.</p>\n<p>Home trade is divided into two;</p>\n<p>a)&nbsp;<strong>Wholesale Trade</strong>: Wholesale trade involves buying in bulk (large quantities) from the producers or manufacturers and selling in small quantities to the retailer&rsquo;s.</p>\n<p>The people that engage in wholesale trade are called wholesalers.</p>\n<p>b)&nbsp;<strong>Retail Trade</strong>: Retail trade involves buying of goods in small quantities from quantities to the final consumer.</p>\n<p>The people engaged in retail trade are called retailers.</p>\n<p>(2)<strong>&nbsp;Foreign Trade</strong>: This is a trade carried out between two or more country&rsquo;s. It is also called International trade.</p>\n<p>Foreign Trade is divided into three;</p>\n<p>a)&nbsp;<strong>Import Trade</strong>: This is the process by which goods are brought into a country from another country.</p>\n<p>b)<strong>&nbsp;Export Trade</strong>: This is the process by which goods are sent out of a country to another country.</p>\n<p>c)&nbsp;<strong>Entreport Trade</strong>: The process by which goods imported are re-exported by back to the country or another country. It is the re-exportation of of imported goods.</p>\n<div class=\"code-block code-block-1\">&nbsp;</div>\n</div>\n</div>\n<div class=\"code-block code-block-2\">&nbsp;</div>\n</div>\n</div>\n</article>\n</main></div>\n</div>\n</div>', '', '', '', '', '', 0, 4, 0, 29, '', 0, 'https://cbspace.sgp1.cdn.digitaloceanspaces.com/kokateclasses/courses/thumbnails/bkd409cd8fb3b3a65221ac6cd567dd5b51.jpg', 'https://cbspace.sgp1.cdn.digitaloceanspaces.com/kokateclasses/courses/background_image/bk8be85dc3c14b0aa74b25f912f866cf76.jpg', 'https://cbspace.sgp1.cdn.digitaloceanspaces.com/kokateclasses/courses/thumbnails/ArkdesBasePageExprimentNo61a8fd538e78de5d2837063d28263c44.mp4', '', 0, '1499.00', 0, '999.00', 0, '999.00', 0, '999.00', '0.00', '0.00', '0.00', 1, 0, 1, '2022-01-20 07:50:47', '2022-02-28 04:50:17'),
